import { Fragment } from "react";
import React from "react";
import Navbar from "./Navbar";
function Cart() {
  return (
    <Fragment>
      <header>
        <Navbar></Navbar>
      </header>
      <section class="home" id="home">
        <div class="content">
          <h3>High Quality Supplemets</h3>
          <span> natural & Pure </span>
          <p>flash sale up to 40% today.</p>
          <a href="#" class="btn">
            shop now
          </a>
        </div>
      </section>
    </Fragment>
  );
}

export default Cart;
